      SELECT DISTINCT - col1 AS col2, col2 * + - 80 * ( - + 36 ) AS col1 FROM tab1 (FORMAT parquet) cor0 WHERE NOT NULL BETWEEN + CAST ( + col2 AS INTEGER ) AND NULL;
  - name: tab1

outputs:
  - name: q2519.out
    data: |
